import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  function person() {
    async function showPerson() {
      let response = await fetch("https://swapi.co/api/people/");
      let person = await response.json();
      console.log(person);
    }
  }
  return <div className="App"></div>;
}

export default App;
